import React, { Component } from 'react';
import { connect } from 'react-redux';
import '../OrderSurvey/css/style.css';

export class OrderSurvey extends Component {
  componentDidMount() {
    const script = document.createElement('script');

    script.src = 'https://code.jquery.com/jquery-1.11.1.min.js';
    script.async = true;

    document.body.appendChild(script);
    const script2 = document.createElement('script');

    script2.src =
      'https://cdn.jsdelivr.net/jquery.validation/1.16.0/jquery.validate.min.js';
    script2.async = true;

    document.body.appendChild(script2);
    const script3 = document.createElement('script');

    script3.src =
      'https://cdn.jsdelivr.net/jquery.validation/1.16.0/additional-methods.min.js';
    script3.async = true;

    document.body.appendChild(script3);
    const script4 = document.createElement('script');

    script4 = jQuery.validator.setDefaults({
      debug: true,
      success: function(label) {
        label.attr('id', 'valid');
      }
    });
    $('#myform').validate({
      rules: {
        password: 'required',
        comfirm_password: {
          equalTo: '#password'
        }
      },
      messages: {
        first_name: {
          required: 'Please enter a firstname'
        },
        last_name: {
          required: 'Please enter a lastname'
        },
        your_email: {
          required: 'Please provide an email'
        },
        password: {
          required: 'Please enter a password'
        },
        comfirm_password: {
          required: 'Please enter a password',
          equalTo: 'Wrong Password'
        }
      }
    });

    script4.async = true;

    document.body.appendChild(script4);
  }
  render() {
    return (
      <div className='form-v4'>
        <div className='page-content'>
          <div className='form-v4-content'>
            <div className='form-left'>
              <h2>INFOMATION</h2>
              <p className='text-1'>
                Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
                eiusmod tempor incididunt ut labore et dolore magna aliqua. Et
                molestie ac feugiat sed. Diam volutpat commodo.
              </p>
              <p className='text-2'>
                <span>Eu ultrices:</span> Vitae auctor eu augue ut. Malesuada
                nunc vel risus commodo viverra. Praesent elementum facilisis leo
                vel.
              </p>
              <div className='form-left-last'>
                <input
                  type='submit'
                  name='account'
                  className='account'
                  value='Have An Account'
                />
              </div>
            </div>
            <form className='form-detail' action='#' method='post' id='myform'>
              <h2>REGISTER FORM</h2>
              <div className='form-group'>
                <div className='form-row form-row-1'>
                  <label for='first_name'>First Name</label>
                  <input
                    type='text'
                    name='first_name'
                    id='first_name'
                    className='input-text'
                  />
                </div>
                <div className='form-row form-row-1'>
                  <label for='last_name'>Last Name</label>
                  <input
                    type='text'
                    name='last_name'
                    id='last_name'
                    className='input-text'
                  />
                </div>
              </div>
              <div className='form-row'>
                <label for='your_email'>Your Email</label>
                <input
                  type='text'
                  name='your_email'
                  id='your_email'
                  className='input-text'
                  required
                  pattern='[^@]+@[^@]+.[a-zA-Z]{2,6}'
                />
              </div>
              <div className='form-group'>
                <div className='form-row form-row-1 '>
                  <label for='password'>Password</label>
                  <input
                    type='password'
                    name='password'
                    id='password'
                    className='input-text'
                    required
                  />
                </div>
                <div className='form-row form-row-1'>
                  <label for='comfirm-password'>Comfirm Password</label>
                  <input
                    type='password'
                    name='comfirm_password'
                    id='comfirm_password'
                    className='input-text'
                    required
                  />
                </div>
              </div>
              <div className='form-checkbox'>
                <label className='container'>
                  <p>
                    I agree to the{' '}
                    <a href='#' className='text'>
                      Terms and Conditions
                    </a>
                  </p>
                </label>
                <input type='checkbox' name='checkbox' />
                <span className='checkmark'></span>
              </div>
              <div className='form-row-last'>
                <input
                  type='submit'
                  name='register'
                  className='register'
                  value='Register'
                />
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(OrderSurvey);
